import { useEffect, useState } from "react";



function Detail() {

    const [data, setData] = useState([])

    useEffect((e) => {
        e.preventDefault()
        fetch("http://localhost:3005/datadetail")
            .then((res) => {
                return res.json()
            })

            .then((resp) => {
                setData(resp)
            })
    }, [])


    return (

        <div>
            {data.map((item) => (
                <div>
                    <p>{item.brand}</p>
                    <p>{item.name}</p>

                </div>
            ))}

        </div>
    )
}
export default Detail;
